function App() {
  return (
    <div className="App">
          <h1>Todo List</h1>

          <TextField id="filled-basic" label="Todo Message" variant="filled" />
          <Button variant="contained">Send</Button>
          <Grid container spacing={2}>
            <Grid xs={8}>
              <Item>xs=8</Item>
            </Grid>
            <Grid xs={4}>
              <Item>xs=4</Item>
            </Grid>
          </Grid>
    </div>
  );
}

export default App;
